import Menu from '../Menu/Menu';

const Header = () => {
  return (
    <div className='header'>
      <div className='header_container'>
        <div className='header_logo'>
          <img src='' alt='' />
        </div>
        <ul className='header_menu'>
          <Menu />
        </ul>
      </div>
    </div>
  );
};

export default Header;
